    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1948.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, and raptors- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. The public relations section of the report
    describes recreational uses. Items of interest, N-R forms, and narrative reports
    on Clear Lake National Wildlife Refuge, Upper Klamath National Wildlife Refuge,
    and Lower Klamath National Wildlife Refuge are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
